import React from "react";
import HeroSection from "./HeroSection";
import ServiciosDestacados from "../components/";

const Home = () => {
    return (
        <div className="bg-gray-100">
            <HeroSection />
            <ServiciosDestacados />
        </div>
    );
};

export default Home;
